response.about:
Гордится - своими родителями;
Восхищается - музыкой 60-х;
Любит - сочинять песни и кофе;
Стремится - дарить людям улыбки;
Мечтает - открыть свой продюсерский центр.

О себе:
Из-за развода родителей и того, что вынужден был жить то с одним, то с другим, часто переезжал и сменил около 6 школ, учился в Музыкальном Колледже. В данный момент студент МИРТШБ. Помимо музыки увлекаюсь дизайном.
В детстве увлекался музыкой 60-х, и очень хотел научиться играть на гитаре. Чтобы купить себе первую гитару, пришлось продать игровую приставку и футбольный мяч. Это было трудным решением, но все - таки музыка взяла свое.
В музыке меня интересовали все инструменты, и я стал самостоятельно изучать фортепиано, домру, бас гитару, так же учился на дирижера.
